import { ArrowCircleDownIcon, ArrowCircleUpIcon } from "@heroicons/react/outline";

function Voting()
{
    return(
    <div className = {'inline flex ' }>
        <p className = "my-1 py-2 text-xs mx-2"> voting goes here </p>
        <ArrowCircleUpIcon className = "mt-2 h-6 w-6 bg-theme_dark-highlight"/>
        <ArrowCircleDownIcon className = "mt-2 h-6 w-6 bg-theme_dark-highlight"/>
    </div>
    );
}

export default Voting;
